package com.higgs.trust.slave.dao.po.manage;import com.higgs.trust.slave.dao.po.BaseEntity;import java.util.Date;public class RsPubKeyPO extends BaseEntity<RsPubKeyPO> {    private static final long serialVersionUID = 1L;    /**     * rs ID     */    private String rsId;    /**     * public key     */    private String pubKey;    /**     * description about rs     */    private String desc;    /**     * create time     */    private Date createTime;    public String getRsId() {        return this.rsId;    }    public void setRsId(String rsId) {        this.rsId = rsId;    }    public String getPubKey() {        return this.pubKey;    }    public void setPubKey(String pubKey) {        this.pubKey = pubKey;    }    public String getDesc() {        return this.desc;    }    public void setDesc(String desc) {        this.desc = desc;    }    public Date getCreateTime() {        return this.createTime;    }    public void setCreateTime(Date createTime) {        this.createTime = createTime;    }    @Override public String toString() {        StringBuilder builder = new StringBuilder();        builder.append("RsPubKeyPO [");        builder.append("rsId=");        builder.append(rsId);        builder.append(", pubKey=");        builder.append(pubKey);        builder.append(", desc=");        builder.append(desc);        builder.append(", createTime=");        builder.append(createTime);        builder.append("]");        return builder.toString();    }}